export const Srijan = () => {
  const [title,SetTitle] = useState
  return (
    <div className='flex mt-5 justify-center'>
      <form className="formStyle space-y-3 border border-black p-5 rounded">
        <h1 className="text-lg">Upload PDF</h1>
        <input type="text" className='border border-black p-2 rounded outline-none' placeholder='Title' />
        <input type="file" className='form-control' accept='application/pdf' required />
        <button className='btn btn-primary'>submit</button>
      </form>
    </div>
  );
}

